def entance(items, item):
    low = 1
    high = len(items) - 1
    while low <= high:
        mid = (low + high) // 2
        guess = items[mid]
        if guess == item:
            return mid
        elif guess > item:
            high = mid - 1
        else:
            low = mid + 1
    return -1

